import React from 'react';
import { MdCake, MdRestaurant, MdShoppingCart, MdLocalDrink, MdLocalPharmacy} from 'react-icons/md'

function Homepage() {
    return (
        <>
        
            <h2>Order your items straight to your door!</h2>
            <p>Use the tabs above to navigate the store and find your items.</p>
            <MdCake className="products" />
            <MdRestaurant className="products" />
            <MdShoppingCart className="products" />
            <MdLocalDrink className="products" />
            <MdLocalPharmacy className="products" />
        
        </>
    );
}

export default Homepage;
